   "1.5": "Dici  2030, renforcer la rsilience des pauvres et des personnes en situation vulnrable et rduire leur exposition aux phnomnes climatiques extrmes et  dautres chocs et catastrophes dordre conomique, social ouenvironnemental et leur vulnrabilit",
