   "10.1": "Dici  2030, assurer progressivement et durablement une croissance des revenus des 40pourcent de la population les plus pauvres  un rythme plus rapide que le revenu moyen national",
   "10.2": "Dici  2030, autonomiser toutes les personnes et favoriser leur intgration sociale, conomique et politique, indpendamment de leur ge, de leur sexe, de leur handicap, de leur race, de leur appartenance ethnique, de leurs origines, de leur religion ou de leur statut conomique ouautre",
   "10.3": "Assurer lgalit des chances et rduire lingalit des rsultats, notamment en liminant les lois, politiques etpratiques discriminatoires et en encourageant ladoption de lois, politiques et mesures adquates en la matire",
   "10.4": "Adopter des politiques, notamment sur les plans budgtaire, salarial et dans le domaine de la protection sociale, afin de parvenir progressivement  une plus grande galit",
   "10.5": "Amliorer la rglementation et la surveillance des institutions et marchs financiers mondiaux et renforcer lapplication des rgles",
   "10.6": "Faire en sorte que les pays en dveloppement soient davantage reprsents et entendus lors de la prise de dcisions dans les institutions conomiques et financires internationales, afin que celles-ci soient plus efficaces, crdibles, transparentes et lgitimes",
   "10.7": "Faciliter la migration et la mobilit de faon ordonne, sre, rgulire et responsable, notamment par lamise en uvre de politiques migratoires planifies et biengres",
   "10.A": "Mettre en uvre le principe dun traitement spcial etdiffrenci pour les pays en dveloppement, en particulier les pays les moins avancs, conformment aux accords de lOrganisation mondiale du commerce",
   "10.B": "Stimuler laide publique au dveloppement et les flux financiers, ycompris les investissements trangers directs, en faveur des tats qui en ont le plus besoin, en particulier les pays les moins avancs, les pays dAfrique, les petits tats insulaires en dveloppement et les pays en dveloppement sans littoral, conformment  leurs plans etprogrammes nationaux",
   "10.C": "Dici  2030, faire baisser au-dessous de 3pourcent les cots de transaction des envois de fonds effectus par lesmigrants et liminer les circuits denvois de fonds dont les cots sont suprieurs  5pourcent",
   "11.1": "Dici  2030, assurer laccs de tous  un logement etdes services de base adquats et srs,  un cot abordable, etassainir les quartiers de taudis",
   "11.2": "Dici  2030, assurer laccs de tous  des systmes de transport srs, accessibles et viables,  un cot abordable, en amliorant la scurit routire, notamment en dveloppant les transports publics, une attention particulire devant tre accorde aux besoins des personnes en situation vulnrable, des femmes, des enfants, des personnes handicapes et des personnes ges",
   "11.3": "Dici  2030, renforcer lurbanisation durable pour tous et les capacits de planification et de gestion participatives, intgres et durables des tablissements humains dans tous les pays",
   "11.4": "Redoubler defforts pour protger et prserver lepatrimoine culturel et naturel mondial",
   "11.5": "Dici  2030, rduire nettement le nombre de personnes tues et le nombre de personnes touches par lescatastrophes, ycompris celles qui sont lies  leau, et rduire nettement la part du produit intrieur brut mondial reprsente par les pertes conomiques directement imputables  ces catastrophes, laccent tant mis sur la protection des pauvres et des personnes en situation vulnrable",
   "11.6": "Dici  2030, rduire limpact environnemental ngatif des villes par habitant, ycompris en accordant une attention particulire  la qualit de lair et  la gestion, notamment municipale, des dchets",
   "11.7": "Dici  2030, assurer laccs de tous, en particulier des femmes et des enfants, des personnes ges et des personnes handicapes,  des espaces verts et des espaces publics srs",
   "11.A": "Favoriser ltablissement de liens conomiques, sociaux et environnementaux positifs entre zones urbaines, priurbaines et rurales en renforant la planification du dveloppement  lchelle nationale et rgionale",
   "11.B": "Dici  2020, accrotre nettement le nombre de villes et dtablissements humains qui adoptent et mettent en uvre des politiques et plans daction intgrs en faveur de linsertion de tous, de lutilisation rationnelle des ressources, de ladaptation aux effets des changements climatiques et de leur attnuation et de la rsilience face aux catastrophes, et laborer et mettre en uvre, conformment au Cadre de Sendai pour la rduction des risques de catastrophe (20152030), une gestion globale des risques de catastrophe  tous les niveaux",
   "11.C": "Aider les pays les moins avancs, ycompris par une assistance financire et technique,  construire des btiments durables et rsilients en utilisant des matriaux locaux",
   "12.1": "Mettre en uvre le Cadre dcennal de programmation concernant les modes de consommation et de production durables avec la participation de tous les pays, les pays dvelopps montrant lexemple en la matire, compte tenu du degr de dveloppement et des capacits despays en dveloppement",
