   "12.3": "Dici  2030, rduire de moiti  lchelle mondiale le volume de dchets alimentaires par habitant, au niveau de la distribution comme de la consommation, et diminuer les pertes de produits alimentaires tout au long des chanes de production et dapprovisionnement, ycompris les pertes aprs rcolte",
   "12.4": "Dici  2020, parvenir  une gestion cologiquement rationnelle des produits chimiques et de tous les dchets tout au long de leur cycle de vie, conformment aux principes directeurs arrts  lchelle internationale, et rduire nettement leur dversement dans lair, leau et le sol, afin deminimiser leurs effets ngatifs sur la sant et lenvironnement",
   "12.5": "Dici  2030, rduire nettement la production de dchets par la prvention, la rduction, le recyclage et la rutilisation",
   "12.6": "Encourager les entreprises, en particulier les grandes entreprises et les socits transnationales,  adopter des pratiques viables et  intgrer dans les rapports quelles tablissent des informations sur la viabilit",
   "12.7": "Promouvoir des pratiques durables dans le cadre dela passation des marchs publics, conformment aux politiques et priorits nationales",
   "12.8": "Dici  2030, faire en sorte que toutes les personnes, partout dans le monde, aient les informations et connaissances ncessaires au dveloppement durable et  un style de vie en harmonie avec la nature",
   "12.A": "Aider les pays en dveloppement  se doter des moyens scientifiques et technologiques qui leur permettent de sorienter vers des modes de consommation et de production plus durables",
   "12.B": "Mettre au point et utiliser des outils de contrle delimpact sur le dveloppement durable dun tourisme durable crateur demplois et valorisant la culture et les produits locaux",
   "12.C": "Rationaliser les subventions aux combustibles fossiles qui sont source de gaspillage, grce  llimination des distorsions du march, eu gard au contexte national, ycompris au moyen de la restructuration de la fiscalit et de la suppression progressive des subventions prjudiciables qui sont en place, en mettant en vidence leur impact sur lenvironnement, en tenant pleinement compte des besoins et de la situation propres aux pays en dveloppement et en rduisant au minimum les ventuels effets ngatifs sur le dveloppement de ces pays tout en protgeant les pauvres etles populations concernes",
   "13.1": "Renforcer, dans tous les pays, la rsilience et les capacits dadaptation face aux alas climatiques et aux catastrophes naturelles lies au climat",
   "13.2": "Incorporer des mesures relatives aux changements climatiques dans les politiques, les stratgies et la planification nationales",
   "13.3": "Amliorer lducation, la sensibilisation et les capacits individuelles et institutionnelles en ce qui concerne ladaptation aux changements climatiques, lattnuation de leurs effets et la rduction de leur impact etles systmes dalerte rapide",
   "13.A": "Mettre en uvre lengagement que les pays dvelopps parties  la Convention-cadre des Nations Unies sur les changements climatiques ont pris de mobiliser ensemble auprs de multiples sources 100milliards de dollars par an dici  2020 pour rpondre aux besoins des pays en dveloppement en ce qui concerne les mesures concrtes dattnuation et la transparence de leur mise en uvre et rendre le Fonds vert pour le climat pleinement oprationnel en le dotant dans les plus brefs dlais des moyens financiers ncessaires",
   "13.B": "Promouvoir des mcanismes de renforcement des capacits afin que les pays les moins avancs et les petits tats insulaires en dveloppement se dotent de moyens efficaces de planification et de gestion pour faire face aux changements climatiques, laccent tant mis, notamment, surles femmes, les jeunes, la population locale et les groupes marginaliss",
   "14.1": "Dici  2025, prvenir et rduire nettement la pollution marine de tous types, en particulier celle rsultant des activits terrestres, ycompris les dchets en mer et la pollution par les nutriments",
   "14.2": "Dici  2020, grer et protger durablement les cosystmes marins et ctiers, notamment en renforant leurrsilience, afin dviter les graves consquences de leurdgradation et prendre des mesures en faveur de leur restauration pour rtablir la sant et la productivit des ocans",
   "14.3": "Rduire au maximum lacidification des ocans etlutter contre ses effets, notamment en renforant la coopration scientifique  tous les niveaux",
