   "8.4": "Amliorer progressivement, jusquen 2030, lefficacit de lutilisation des ressources mondiales dans lesmodes de consommation et de production et sattacher dissocier croissance conomique et dgradation de lenvironnement, comme prvu dans le Cadre dcennal de programmation concernant les modes de consommation et de production durables, les pays dvelopps montrant lexemple en la matire",
   "8.5": "Dici  2030, parvenir au plein emploi productif et garantir  toutes les femmes et  tous les hommes, ycompris les jeunes et les personnes handicapes, un travail dcent et un salaire gal pour un travail de valeur gale",
   "8.6": "Dici  2020, rduire nettement la proportion dejeunes non scolariss et sans emploi ni formation",
   "8.7": "Prendre des mesures immdiates et efficaces pour supprimer le travail forc, mettre fin  lesclavage moderne et  la traite dtres humains, interdire et liminer les pires formes de travail des enfants, ycompris le recrutement et lutilisation denfants soldats, et, dici  2025, mettre fin au travail des enfants sous toutes ses formes",
   "8.8": "Dfendre les droits des travailleurs, promouvoir la scurit sur le lieu de travail et assurer la protection de tous les travailleurs, y compris les migrants, en particulier les femmes, et ceux qui ont un emploi prcaire",
   "8.9": "Dici  2030, laborer et mettre en uvre des politiques visant  dvelopper un tourisme durable qui cre des emplois et met en valeur la culture et les produits locaux",
   "8.A": "Accrotre lappui apport dans le cadre de linitiative Aide pour le commerce aux pays en dveloppement, en particulier aux pays les moins avancs, ycompris par lintermdiaire du Cadre intgr renforc pour lassistance technique lie au commerce en faveur des pays les moins avancs",
   "8.B": "Dici  2020, laborer et mettre en uvre une stratgie mondiale en faveur de lemploi des jeunes et appliquer le Pacte mondial pour lemploi de lOrganisation internationale du Travail",
   "9.1": "Mettre en place une infrastructure de qualit, fiable, durable et rsiliente, ycompris une infrastructure rgionale et transfrontire, pour favoriser le dveloppement conomique et le bien-tre de ltre humain, en privilgiant un accs universel, financirement abordable et quitable",
   "9.2": "Promouvoir une industrialisation durable qui profite  tous et, dici  2030, augmenter nettement la contribution de lindustrie  lemploi et au produit intrieur brut, en fonction du contexte national, et la multiplier par deux dans les pays les moins avancs",
   "9.3": "Accrotre, en particulier dans les pays en dveloppement, laccs des entreprises, notamment des petites entreprises industrielles, aux services financiers, ycompris aux prts consentis  des conditions abordables, etleur intgration aux chanes de valeur et aux marchs",
   "9.4": "Dici  2030, moderniser linfrastructure et adapter les industries afin de les rendre durables, par une utilisation plus rationnelle des ressources et un recours accru aux technologies et procds industriels propres et respectueux de lenvironnement, chaque pays agissant dans la mesure de ses moyens",
   "9.5": "Renforcer la recherche scientifique, perfectionner les capacits technologiques des secteurs industriels de tous les pays, en particulier des pays en dveloppement, notamment en encourageant linnovation et en augmentant nettement le nombre de personnes travaillant dans le secteur de la recherche-dveloppement pour 1million dhabitants et en accroissant les dpenses publiques et prives consacres  la recherche-dveloppement dici  2030",
   "9.A": "Faciliter la mise en place dune infrastructure durable et rsiliente dans les pays en dveloppement en renforant lappui financier, technologique et technique apport aux pays dAfrique, aux pays les moins avancs, aux pays en dveloppement sans littoral et aux petits tats insulaires en dveloppement",
   "9.B": "Soutenir les activits de recherche-dveloppement etdinnovation des pays en dveloppement dans le secteur technologique, notamment en instaurant des conditions propices, entre autres,  la diversification industrielle et lajout de valeur aux marchandises",
   "9.C": "Accrotre nettement laccs aux technologies de linformation et des communications et faire en sorte que tous les habitants des pays les moins avancs aient accs Internet  un cot abordable dici  2020"
